ue with duplicate UI entries in categories mapping\"], \"1.3.0\": [\"Adjusted functionality for getting Plugin compatible with SW6.4\", \"Add default payment for ebay sales channel\", \"Add filter for product list\", \"Add AVV for contracts\", \"Fixed payment method matching for ebay with more than 25 payment methods\"], \"1.3.1\": [\"Fixed compatibility with PayPal Plugin\"], \"1.3.2\": [\"Only valid PayPal email addresses will be stored\", \"Only Logo URL with https protocol will be stored\", \"Fixed bug for saving attributes mapping\"], \"1.3.3\": [\"Bug fix with listing of empty attribute mappings\"], \"1.3.4\": [\"Add feature to recreate the integration user in sw and business platform\", \"Bugfix for removal of integration user\", \"Implements asin matching on products list\", \"Text changes\"], \"1.3.5\": [\"Add router link to product list to enable routing directly to the products\", \"Fixed pagination for search and for initial product list\", \"Fixed the ebay auth link processing\", \"Fixed pagination and search field for Attribute mapping modal window\"], \"1.3.6\": [\"fixed url for opening products on amazon shop\", \"Add logic to publish deleted articles to the marketplaces\", \"Endpoint to update amazon and eBay take over service status added.\"], \"1.3.7\": [\"changed long errors text visibility\", \"Amazon sales channel configuration for FcShelfLife added.\"], \"1.3.8\": [\"New Ebay sales channel configuration field added to configure the brand name as manufacturer.\", \"Fixed the ebay auth link processing\"], \"1.1.10\": [\"Adding multiselect for countries at sales channel general page.\", \"Bugfix preventing error in console. Wrong variable type was sent to component.\"], \"1.2.10\": [\"Plugin will store information about sales channel id & sales channel api key every time the ui will loaded\", \"Bugfix on installation with default language not being German or English\", \"Bugfix for ebay payment method mapping\", \"Uninstall issue fixed\"], \"majo